import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Welcome to FF Helper</h2>
      <form id="myForm">
        <input type="file" id="csvFile" accept=".csv" />
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}

export default App;
